import React from "react";
import './Paged.css';



export default function Paged({pokePerPage, pokemons, paged}){
    let pagedNumber = [];
    for( let i = 0; i <= Math.ceil(pokemons/pokePerPage) - 1; i++){
        pagedNumber.push(i + 1)
    }

    return (
        <div className="paged">
            <ul className="lista">
                { pagedNumber && pagedNumber.map(number => {
                    return (
                    <li key={number}>
                        <p onClick={() => paged(pagedNumber)}>{number}</p>
                    </li>
                           )
                })}
            </ul>
        </div>

    )
}
